import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Login from './Login';
import Admin from './Admin';
import Newuser from './Newuser';
import User from './Users';
import { UserProvider } from './UserContext';
import ProtectedRoute from './ProtectedRoute'; // Make sure to import ProtectedRoute

function App() {
  return (
    <Router>
      <UserProvider>
        <div className="App">
          <Routes>
            <ProtectedRoute path="/" element={<Login />} />
            <ProtectedRoute path="/admin" element={<Admin />} roles={['admin']} />
            <ProtectedRoute path="/newuser" element={<Newuser />} roles={['admin']} />
            <ProtectedRoute path="/users" element={<User />} roles={['user', 'admin']} />
            <Route path="/login" element={<Login />} />
          </Routes>
        </div>
      </UserProvider>
    </Router>
  );
}

export default App;
